import React, { useState } from 'react';
const axios = require('axios');

function Nedbetalingsplan() {
    const [count, setCount] = useState(0);

    function increment() {
        setCount(count + 1);
    }

    function decrement() {
        if (count >= 0) {
            setCount(count - 1);
        } else {
            alert("Impossible to go lower than zero")
        }
    }

    function handlePost() {

        const options = {
            method: 'POST',
            url: 'https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan',
            headers: { 'Content-type': 'application/json' },
            data: {
                laanebelop: 2000000,
                nominellRente: 3,
                terminGebyr: 30,
                utlopsDato: "2025-01-01",
                saldoDato: "2020-01-01",
                datoForsteInnbetaling: "2020-02-01",
                ukjentVerdi: "TERMINBELOP"

            }
        }


        axios(options).then(function (response) {
            console.log(response)
            console.log(response.data.nedbetalingsplan)
        }).catch(function (error) {
            console.log(error);
        });

    }

    handlePost()

    return (
        <div>
            <button onChange={decrement}>-</button>
            <input type="text" placeholder={count}></input>
            <button onChange={increment}>+</button>
        </div>
    )

}
export default Nedbetalingsplan;
